  const [submitForm, { data }] = useMutation(SUBMIT_FORM_MUTATION);

  const onSubmit = async (event) => {
    event.preventDefault();
    try {
      const { data } = await submitForm({ variables: { input: formState } });
      console.log(data);
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <form onSubmit={onSubmit}>
      <input
        value={formState.field1}
        onChange={(e) => setFormState({ ...formState, field1: e.target.value })}
      />
      <input
        value={formState.field2}
        onChange={(e) => setFormState({ ...formState, field2: e.target.value })}
      />
      <button type="submit">Submit</button>
    </form>
  );
}

export default MyForm;
```
