package main

import (
	"fmt"
	"net"
	"sync"

	"github.com/miekg/dns"
)

var (
	resolvers = []string{"8.8.8.8:53", "1.1.1.1:53"}
	cache     = make(map[string]string)
	cacheLock = sync.Mutex{}
)

func main() {
	dns.HandleFunc(".", handleRequest)
	server := &dns.Server{Addr: ":53", Net: "udp"}
	err := server.ListenAndServe()
	if err != nil {
		fmt.Println("Failed to start server:", err)
	}
}

func handleRequest(w dns.ResponseWriter, req *dns.Msg) {
	m := new(dns.Msg)
	m.SetReply(req)

	for _, r := range req.Question {
		qtype := fmt.Sprintf("%s", dns.TypeToString[r.Qtype])
		cacheLock.Lock()
		ip, exists := cache[r.Name]
		cacheLock.Unlock()

		if exists {
			m.Answer = append(m.Answer, &dns.TXT{
				Hdr: dns.RR_Header{
					Name:   r.Name,
					Rrtype: dns.TypeTXT,
					Class:  dns.ClassINET,
					Ttl:    60,
				},
				Txt: []string{ip},
			})
			continue
		}

		for _, resolver := range resolvers {
			c := new(dns.Client)
			r, _, err := c.Exchange(req, resolver)
			if err != nil {
				fmt.Println("Failed to resolve:", err)
				continue
			}

			for _, a := range r.Answer {
				if a.Header().Rrtype == dns.TypeA {
					ip := a.(*dns.A).A.String()
					cacheLock.Lock()
					cache[r.Question[0].Name] = ip
					cacheLock.Unlock()

					m.Answer = append(m.Answer, a)
					break
				}
